import React, { Component, Fragment } from "react";

export default function Counter() {
  const state = {
    count: 0,
    imageUrl: "../agriculture-economy.png"
  };
  const styles = {
    color: "red",
    width:"10em",
    backgroundColor:"white",
    marginLeft : "0.1em"
  };
  const btn = {
    color: "white",
    height: "2.5em",
    width: "3.5em",
    backgroundColor: "red"
  };
  const btn1 = {
    color: "white",
    height: "2.5em",
    width: "7em",
    backgroundColor: "blue"
  };
  const btn2 = {
    color: "white",
    height: "2.5em",
    width: "3.5em",
    backgroundColor: "green"
  };
  const btn3 = {
    color: "white",
    height: "2.5em",
    width: "3.5em",
    backgroundColor: "blue"
  };
  return (
    <Fragment>
      <h3>My Calculator</h3>
      {/* <img src="/agriculture-economy.png" alt="hey"/> */}
      <div class="sel">Select any of the operations</div>
      <div style={styles}>{state.count}</div>
      <div>
      <button style={btn}>Zero</button>
      <button style={btn1}>Increment</button>
      </div>
      <div>
        <button style={btn2}>1</button>
        <button style={btn2}>2</button>
        <button style={btn2}>3</button>
      </div>
      <div>
        <button style={btn2}>4</button>
        <button style={btn2}>5</button>
        <button style={btn2}>6</button>
      </div>
      <div>
        <button style={btn2}>7</button>
        <button style={btn2}>8</button>
        <button style={btn2}>9</button>
      </div>
      <div>
        <button style={btn3}>+</button>
        <button style={btn3}>-</button>
        <button style={btn3}>/</button>
      </div>
      <div>
        <button style={btn3}>*</button>
        <button style={btn3}>%</button>
        <button style={btn2}>=</button>
      </div>
    </Fragment>
  );
}

